    // May be useful in future
    internal static class ElementTable
    {
        private struct ElementDesc
        {
            public readonly Type type;
            public readonly String namespaceUri;
            public readonly String localName;

            public ElementDesc(Type type, String namespaceUri, String localName)
            {
                this.type = type;
                this.namespaceUri = namespaceUri;
                this.localName = localName;
            }
        }

        private class ElementKey
        {
            public string NamespaceUri { get; private set; }

            public string LocalName { get; private set; }

            public ElementKey(string localName, string namespaceUri)
            {
                NamespaceUri = namespaceUri;
                LocalName = localName;
            }

            public override bool Equals(object obj)
            {
                ElementKey other = obj as ElementKey;
                if (obj != null)
                    return other.NamespaceUri == NamespaceUri &&
                        other.LocalName == LocalName;
                return false;
            }

            public override int GetHashCode()
            {
                return (NamespaceUri.GetHashCode() << 6) ^ LocalName.GetHashCode();
            }
        }

        static ElementTable()
        {
            _dict = new Dictionary<ElementKey, Type>();
            foreach (ElementDesc desc in _tab)
                _dict.Add(new ElementKey(desc.localName, desc.namespaceUri), desc.type);
        }

        public static OpenXmlElement CreateElement(string prefix, string localName, string namespaceUri)
        {
            Type type;
            if (_dict.TryGetValue(new ElementKey(localName, namespaceUri), out type))
                return (OpenXmlElement)Activator.CreateInstance(type);
            return new OpenXmlUnknownElement(prefix, localName, namespaceUri);
        }

